<!DOCTYPE html><html lang='en'><head><meta charset='utf-8' /><head>
<title>Pretty Output of DisassemblyDiagnoser for DotNetTips.Spargine.Extensions.BenchmarkTests.Tester.RandomDataBenchmark-20250415-034125</title>

<style type="text/css">
    pre { margin: 0px; }
    table { border-collapse:collapse; }
    td.perMethod { border-top: 1px black solid; }
    tr.evenMap td { background-color: #F5F5F5; }  
</style>

<style type='text/css'>
    td.label:hover { cursor: pointer; background-color: yellow !important; }
    td.highlighted { background-color: yellow !important; }
</style></head><body>
<script src="https://ajax.aspnetcdn.com/ajax/jQuery/jquery-3.2.1.min.js"></script>
<script>$(document).ready(function () {
    var selectedIndex = 0;

    function highlight() {
        $('td.reference.highlighted').removeClass('highlighted');

        var selectedLabel = $(this).attr('data-label');
        if (selectedLabel) {
            $('td.reference[data-reference=' + selectedLabel + ']').addClass('highlighted');
        }
        selectedIndex = 0;
    }

    function selectNext() {
        var $highlighted = $('td.reference.highlighted');
        var selected = $highlighted[selectedIndex++ % $highlighted.length];

        if (selected) {
            var selectedReference = $(selected).attr('id');
            if (selectedReference) {
                window.location.hash = '#' + selectedReference;
            }
        }
    }

    $('td.label').on('click', highlight);

    $(document).on('keydown', function (event) {
        if (event.keyCode == 114) { // F3
            event.preventDefault();
            // Remap F3 to some other key that the browser doesn't care about
            selectNext();
        }
    });
});</script>
</body></html>
